import React, {FC} from "react";
import { IGoods } from "../../../types/types";

interface MyCheckboxProps {
    good: IGoods;
}

const MyCheckbox:FC<MyCheckboxProps> = ({good}) => {
    return (
        <div>
            <input type="checkbox" name={good.producer}/>
        <label htmlFor={good.producer}>{good.producer}</label>
        </div>

    );
};

export default MyCheckbox
